import React from 'react'
import { Button, Table, Popconfirm, Row, Col } from 'antd'
export default function ProductLimitSetup() {
  const columns = [
    {
      // title: 'Specific Channel Limit',
      dataIndex: 'operation',
      render: (text, record) =>
        dataSource.length >= 1 ? (
          <Popconfirm title="Sure to delete?" onConfirm={() => this.handleDelete(record.key)}>
            <a>Delete</a>
          </Popconfirm>
        ) : null,
    },
    {
      title: 'Product_Code',
      dataIndex: 'name',
      width: '30%',
      editable: true,
    },
    {
      title: 'Product_Description',
      dataIndex: 'age',
    },
    {
      title: 'All-Channel Txn Limit',
      dataIndex: 'address',
    },
    {
      title: 'Specific Channel Limit',
      dataIndex: 'operation',
    },
  ];
  const dataSource = [
    {
      key: '0',
      name: 'Edward King 0',
      age: '32',
      address: 'London, Park Lane no. 0',
    },
    {
      key: '1',
      name: 'Edward King 1',
      age: '32',
      address: 'London, Park Lane no. 1',
    },
  ]
  return (
    <div>
      <Row>
        <Button
          // onClick={this.handleAdd}
          type="primary"
          style={{
            marginBottom: 16,
          }}
        >Add a row</Button>
      </Row>
      <Row>
        <Col flex={100}>
          <Table
            // components={components}
            rowClassName={() => 'editable-row'}
            bordered
            dataSource={dataSource}
            columns={columns}
          />
        </Col>

      </Row>
    </div>
  )
}
